//   } },[resItem])

  useMemo(() => {
      if (items.url==undefined){
    setItems([item])}
    else {setItems([...items, item]) }
   }, [item])

  const handleClickClear = () => {
    alert("Clear");
  };
  const handelClickGroup = () => {
    alert("Group");
  };


  const renderCards = () => {
    if(items.length>0){
        return (
      <div>12345678</div>)
    }
  };

  return (
    <div>
      <Row
        onClickLoading={handleClickLoading}
        onClickClear={handleClickClear}
        onClickGroup={handelClickGroup}
      />
      {renderCards()}
      {console.log(items)}
      {console.log("url" in items)}

    </div>
  );
}
